import React, { Component } from 'react'
import {Spring} from 'react-spring/renderprops'
export default class Fold extends Component {
  render() {
    return (
      <div>
        <Spring
           from={{ opacity: 0,margin:0 }}
            to={{ opacity: 1 ,margin:50+"%"}}>
          {props => <div style={props}><h1>hello world</h1></div>}
          </Spring>

          <Spring
           from={{ opacity: 0 }}
            to={{ opacity: 1 }}>
          {props => <div style={props}><p>Lorem Ipsum is simply dummy text of the printing and typesetting</p></div>}
          </Spring>
      </div>
    )
  }
}
